import React, { useState } from "react";
import TopBar from "../components/TopBar";
import Footer from "../components/Footer";
import moment from "moment";
import axios from "axios";

function ClientCheckin() {
  const [clientName, setClientName] = useState("");
  const [organization, setOrganization] = useState("");
  const [tablingSpot, setTablingSpot] = useState("");
  const [eventNumber, setEventNumber] = useState("");
  const [checkInTime] = useState(moment().format("hh:mm A"));

  const [requireTable, setRequireTable] = useState(false);
  const [tableBarcode, setTableBarcode] = useState("");
  const [tableError, setTableError] = useState(null);

  const [requireChairs, setRequireChairs] = useState(false);
  const [chairCount, setChairCount] = useState(0);
  const [chairBarcodes, setChairBarcodes] = useState(["", ""]);
  const [chairErrors, setChairErrors] = useState([null, null]);

  const [feedback, setFeedback] = useState("");

  const validateTableBarcode = async (barcode) => {
    try {
      const res = await axios.get(`/api/items/${barcode}`);
      const item = res.data;
      if (item.category !== "Mall Table") {
        setTableError("Barcode is not a table.");
      } else if (!item.isAvailable) {
        setTableError("Table is already checked out.");
      } else {
        setTableError(null);
      }
    } catch {
      setTableError("Table not found.");
    }
  };

  const validateChairBarcode = async (barcode, index) => {
    try {
      const res = await axios.get(`/api/items/${barcode}`);
      const item = res.data;
      if (item.category !== "Mall Chair") {
        const updated = [...chairErrors];
        updated[index] = "Barcode is not a chair.";
        setChairErrors(updated);
      } else if (!item.isAvailable) {
        const updated = [...chairErrors];
        updated[index] = "Chair is already checked out.";
        setChairErrors(updated);
      } else {
        const updated = [...chairErrors];
        updated[index] = null;
        setChairErrors(updated);
      }
    } catch {
      const updated = [...chairErrors];
      updated[index] = "Chair not found.";
      setChairErrors(updated);
    }
  };

  const handleSubmit = async () => {
    const payload = {
      clientName,
      organization,
      tablingSpot,
      eventNumber,
      checkInTime,
      tableBarcode: requireTable ? tableBarcode : null,
      chairBarcodes: requireChairs ? chairBarcodes.slice(0, chairCount) : [],
    };

    try {
      await axios.post("/api/organizations/checkin", payload);
      setFeedback("Check-in logged successfully.");
      setClientName("");
      setOrganization("");
      setTablingSpot("");
      setEventNumber("");
      setTableBarcode("");
      setChairBarcodes(["", ""]);
      setChairErrors([null, null]);
      setRequireTable(false);
      setRequireChairs(false);
      setChairCount(0);
    } catch (error) {
      setFeedback("Failed to submit. Please check inputs or try again.");
    }
  };

  return (
    <>
      <TopBar />
      <div className="min-h-screen bg-gray-900 text-white p-6 flex flex-col items-center">
        <h2 className="text-3xl font-bold text-asuGold mb-6">Client Check-In</h2>

        <div className="w-full max-w-xl space-y-4">
          <input
            type="text"
            placeholder="Client Name"
            value={clientName}
            onChange={(e) => setClientName(e.target.value)}
            className="w-full p-3 rounded bg-gray-800 border border-gray-600"
          />

          <input
            type="text"
            placeholder="Organization Name"
            value={organization}
            onChange={(e) => setOrganization(e.target.value)}
            className="w-full p-3 rounded bg-gray-800 border border-gray-600"
          />

          <input
            type="text"
            placeholder="Tabling Spot #"
            value={tablingSpot}
            onChange={(e) => setTablingSpot(e.target.value)}
            className="w-full p-3 rounded bg-gray-800 border border-gray-600"
          />

          <input
            type="text"
            placeholder="Event #"
            value={eventNumber}
            onChange={(e) => setEventNumber(e.target.value)}
            className="w-full p-3 rounded bg-gray-800 border border-gray-600"
          />

          <input
            type="text"
            value={checkInTime}
            readOnly
            className="w-full p-3 rounded bg-gray-700 border border-gray-500 text-white/70"
          />

          {/* Table requirement toggle */}
        <div className="text-center bg-gray-700">
             <p className="mb-1 text-center font-medium">Do they require a table?</p>
            <div className="flex gap-4">
              <button
                onClick={() => setRequireTable(true)}
                className={`px-4 py-2 rounded ${requireTable ? "bg-green-600" : "bg-gray-700"}`}
              >
                Yes
              </button>
              <button
                onClick={() => {
                  setRequireTable(false);
                  setTableBarcode("");
                  setTableError(null);
                }}
                className={`px-4 py-2 rounded ${!requireTable ? "bg-red-600" : "bg-gray-700"}`}
              >
                No
              </button>
            </div>
            {requireTable && (
              <div className="mt-3">
                <input
                  type="text"
                  placeholder="Table Barcode"
                  value={tableBarcode}
                  onChange={(e) => {
                    setTableBarcode(e.target.value);
                    validateTableBarcode(e.target.value);
                  }}
                  className="w-full p-2 mt-1 rounded bg-gray-800 border border-gray-600"
                />
                {tableError && <p className="text-red-400 text-sm mt-1">{tableError}</p>}
              </div>
            )}
          </div>
          {/* Chair requirement toggle */}
          <div>
            <p className="mb-1 text-center font-medium">Do they require chairs?</p>
            <div className="flex gap-4">
              <button
                onClick={() => setRequireChairs(true)}
                className={`px-4 py-2 rounded ${requireChairs ? "bg-green-600" : "bg-gray-700"}`}
              >
                Yes
              </button>
              <button
                onClick={() => {
                  setRequireChairs(false);
                  setChairCount(0);
                  setChairBarcodes(["", ""]);
                  setChairErrors([null, null]);
                }}
                className={`px-4 py-2 rounded ${!requireChairs ? "bg-red-600" : "bg-gray-700"}`}
              >
                No
              </button>
            </div>

            {requireChairs && (
              <div className="mt-3 text-center">
                <label className="block mb-1">How many chairs?</label>
                <select
                  value={chairCount}
                  onChange={(e) => {
                    const count = parseInt(e.target.value);
                    setChairCount(count);
                    setChairBarcodes(Array(count).fill(""));
                    setChairErrors(Array(count).fill(null));
                  }}
                  className="w-full p-2 rounded bg-gray-800 border border-gray-600"
                >
                  <option value="0">0</option>
                  <option value="1">1</option>
                  <option value="2">2</option>
                </select>

                {[...Array(chairCount)].map((_, i) => (
                  <div key={i} className="mt-2">
                    <input
                      type="text"
                      placeholder={`Chair ${i + 1} Barcode`}
                      value={chairBarcodes[i] || ""}
                      onChange={(e) => {
                        const updated = [...chairBarcodes];
                        updated[i] = e.target.value;
                        setChairBarcodes(updated);
                        validateChairBarcode(e.target.value, i);
                      }}
                      className="w-full p-2 rounded bg-gray-800 border border-gray-600"
                    />
                    {chairErrors[i] && <p className="text-red-400 text-sm mt-1">{chairErrors[i]}</p>}
                  </div>
                ))}
              </div>
            )}
          </div>

          {feedback && <p className="mt-4 text-center font-semibold text-yellow-400">{feedback}</p>}

          <button
            onClick={handleSubmit}
            className="mt-6 w-full bg-asuMaroon text-white py-3 font-bold rounded hover:brightness-110"
          >
            Submit Check-In
          </button>
        </div>
      </div>
      <Footer />
    </>
  );
}

export default ClientCheckin;
